import { useQuery } from "react-query"
import readMarkerRequest from "../api/readMarkerRequest";

export default ()=>{

    const {isLoading, data: markers} = useQuery(
        'markers', 
        readMarkerRequest
    )


    
    var countryList = [];
    markers.map((marker)=>(
        countryList.push(marker.country)
    ))
    console.log(countryList)



}
